import React from "react";
import { getalldata } from "./Feature/slice";
import { useSelector, useDispatch } from "react-redux";

function App1() {
  const dispatch = useDispatch();
  const data = useSelector((state) => state.app.users);

  return (
    <div>
      <h1>welcome</h1>
      {data.map((e) => (
        <h1>{console.log("user data" + e.name)}</h1>
      ))}
      <button onClick={() => dispatch(getalldata())}>Submit</button>
    </div>
  );
}

export default App1;
